import '../App.css';

const Main  = () =>
{
    return(
        <div >
        <input type = "button" value = "Movies" class = "menu"/>
        <input type = "button" value = "Subscriptions" class = "menu"/>
        <input type = "button" value = "Users Management" class = "menu"/>
        <input type = "button" value = "Log Out" class = "menu"/>
        </div>
    ) 
}

export default Main
